  [],\n\t\"revision_timestamp\": \"2015-12-20T19:03:14.792015\",\n\t\"name\": \"national-status-and-trends-bioeffects-assessment-program-delaware-bay-summary-database-199752d7b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study was based on the sediment quality
  triad (SQT) approach. A stratified probabilistic sampling design was utilized to
  characterize the Delaware Bay system in terms of chemical contamination, sediment
  toxicity (Microtox, amphipod bioassay; sea urchin gamete bioassay; and P450 biomarker)
  and benthic infaunal community structure. The purpose was to define the extent and
  magnitude of toxicity and other biological effects associated with contaminants
  in the Delaware estuary system from the fall line to the mouth of the Bay. This
  file contains data measured in the Delaware Bay Estuary and adjacent waters during
  1997. Samples were collected for water and sediment analyses.\",\n\t\"license_title\":
